import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Add } from './Add';
import { List } from './List'

export const Tasks = () => {
    return (
        <Router>
            <Switch>
                <Route path='/users/add' component={Add} />
                <Route path='/users/' component={List} />
            </Switch>
        </Router>
    )
}
